import React from "react";
import './nav'
import { Link } from "react-router-dom";

 const NavBar = () => {
  return (
    <div>
      <header className="box-nav" >

            <li><Link to="/">Pokedex</Link></li>
            <li><Link to="/create">Create</Link></li>
            <li><Link to="/team">My team</Link></li>
      
      </header>
    </div>
  );
};
export default NavBar;
